  "Label.T&CDesc1": "The following terms and conditions will apply if you wish to use the Internet for availing a service. Please go through the conditions carefully and if you accept them, you may register yourself and transact on the site. On using this site for service delivery, you are deemed to have agreed to the terms and conditions set forth below. If You do not agree with all these terms and conditions, you must not transact on this Website.",
  "Label.T&CDesc2": "If a user violates the terms and conditions Government (service owner) reserves the right to deactivate all such user registration and cancel any or all services requested without any notice. Garbage / Junk values in profile may lead to Deactivation.",
  "Label.T&CDesc3": "Operationalization of this agreement is subject to existing laws and legal processes of the respective Government, and nothing contained in this agreement is in derogation of Government's right to comply with law enforcement requests or requirements relating to your use of this Web Site or information provided to or gathered by this site with respect to such use. You agree that Government may provide details of your use of the Web Site to regulators or police or to any other third party, or in order to resolve disputes or complaints which relate to the Web Site, at Government’s complete discretion.",
  "Label.T&CDesc4": "This agreement is made between: respective service owner department of the respective government who has configured the serviceGovernment ('Us') and The User ('You'), the individual, whose details  are set out in the Portal User Creation page.",
  "Label.UserCreation": "User Creation",
  "Label.T&CDesc5": "You are responsible for maintaining the confidentiality of the password and account, and are fully responsible for all activities that occur under your password or account.",
  "Label.ComplaintsProcedure": "Complaints Procedure",
  "Label.T&CDesc6": "You can reach us on the contact details given in the 'Contacts' option given in the login page.",
  "Label.GeneralObligations": "General Obligations",
  "Label.T&CDesc7": "You shall access web site only for lawful purposes and you shall be responsible for complying with all applicable laws, statutes and regulations in connection with the use of Government web site. This Website is for your personal or commercial use by approved kiosks. You shall not modify, copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer or sell any information, or services obtained from this Website. You shall not create a hypertext link to the Website or \"frame\" the Website, except with the express advance written permission of the Government.",
  "Label.InformationProvided": "Information Provided",
  "Label.T&CDesc8": "The information you provide in the Registration page must be complete and accurate. Government 00. reserves the right at all times to disclose any information as deems necessary to satisfy any applicable law, regulation, legal process.",
  "Label.Termination": "Termination",
  "Label.T&CDesc9": "We may at any time at our sole discretion and without giving any reason or any prior notice terminate or temporarily suspend your access to all or any part of the web site.",
  "Label.PrivacyPolicyDesc": "The Government will have complete discretion to share the details of your use of the Web Site and/ or data entered by you with regulators or with any other third party, or in order to resolve disputes or complaints which relate to the Web Site.",
  "Label.PaymentOption": "Payment Option",
  "Label.PaymentOptionDesc": "The list of payment options available are internet banking /debit card payment / credit card payment from banks that are listed when selecting each of the above options. Apart from the fee chargeable to Government against each service, bank / payment gateway transaction charges will be applicable extra. In case of a failed transaction the user shall have no right to claim the amount. The loss on this account shall not be borne either by Government or by the Banks /Payment Gateways.",
  "Label.CopyrightPolicy": "Copyright Policy",
  "Label.HyperlinkingPolicy": "Hyperlinking Policy",
  "Label.CopyrightPolicyDesc": "Material featured on this website may be reproduced free of charge after taking proper permission by sending a mail to us. However, the material has to be reproduced accurately and not to be used in a derogatory manner or in a misleading context. Wherever the material is being published or issued to others, the source must be prominently acknowledged. However, the permission to reproduce this material shall not extend to any material which is identified as being copyright of a third party. Authorisation to reproduce such material must be obtained from the departments/copyright holders concerned.",
  "Label.LinkToExternalSite": "Links to external websites/portals",
  "Label.LinkToExternalSiteDesc": "At many places in this website, you shall find links to other websites/portals. These links have been placed for your convenience. This website is not responsible for the contents and reliability of the linked websites and does not necessarily endorse the views expressed in them. Mere presence of the link or its listing on this website should not be assumed as endorsement of any kind. We cannot guarantee that these links will work all the time and we have no control over the availability of linked pages.",
  "Label.LinkToThisSiteByOther": "Links to this Website by other websites/portals",
  "Label.FirstName": "First Name",
  "Label.LinkToThisSiteByOtherDesc": "We do not object to linking directly to the information that is hosted on this site but it is necessary that prior permission is taken before hyperlinks are directed from any website to this site. Permission for the same, stating the nature of the content on the pages from where the link has to be given and the exact language of the hyperlink should be obtained by sending a request to 'egramswaraj[at]gov[dot]in'. Also, it is not permitted that our pages be loaded into frames on the requested site. Our Department's pages must load into a newly opened browser window of the user.",
  "Label.EmailAt": "Email at",
  "Label.eGramEmail": "egramswaraj[at]gov[dot]in",
