  "Label.KilloByte": "KilloByte",
  "Label.QuickStartGuideDesc": "eGramSwaraj is developed by National Informatics Centre, Ministry of Information Technology, Govt. of India for Panchayati Raj Institutions to effectively monitor and manage their accounts. The Quick Start guide provides the users information and step by step instructions to use eGramSwaraj application with ease",
  "Label.ReceiptCancellationDocDesc": "Previously PRI administrators were only authorized to cancel the Receipt Vouchers through Payment Voucher -> Select Nature of Payment as Receipt Cancellation. But there was no provision to edit amount of cancelled Receipt Vouchers. Now PRI administrator can edit amount to return complete or partial amount to the state",
  "Label.20CommonTransactionScenariosDesc": "For better understanding for transactional flow, this presentation provides the 20 common scenarious occuring in our transactions with explainatory examples.",
  "Label.RecordDeductionDocDesc": "There is a provision to record deduction cut under deduction heads (8658/8009/8011) to make an entry of the deductions recorded against employee/agency/PRI/Line Department in eGramSwaraj. Deduction cut entry is recorded through opening balance, payment voucher and journal voucher. In order to give payment for these defined deduction cuts, deduction payment entry is recorded using payment voucher against employee/agency/PRI/Line Department.",
  "Label.UploadVouchersScannedCopyDesc": "New provision of Upload File has been introduced in all four vouchers (Receipt, Payment, Contra and Journal) to upload scanned copy/file/document related to vouchers in eGramSwaraj.<br/>File Upload In Vouchers and Bill Amount options have been added in State Decision form to allow defined facilities at District/Zilla/Block and Village Level. Bill Amount is the amount for which system will ask TIN No if user records payment voucher against Agency with amount equal to or greater than the Bill Amount",
  "Label.CAGFormatDocDesc": "This PDF provides the the guidelines for preparation of Receipt and Payment Accounts expalining various accounting formats and procedures for transactional entries.",
  "Label.ListOfCodesDocDesc": "This file provides the detailed description about the list of codes used in various functions, programmes & activities performed by Panchayats.",
  "Label.FundDiversionDesc": "In eGramSwaraj application there is a provision of fund diversion which comprises of four cycles.",
  "Label.QuickReferenceDesc": "The Quick Reference guide provides the users information and step by step instructions to use eGramSwaraj application with ease.",
  "Label.PresentationDesc": "The presentation for eGramSwaraj mainly focus on the following aspects:<ol><li>Objectives of eGramSwaraj such as facilitating decentralized planning, progress reporting, and accounting of activities</li><li>eGramSwaraj Stake holders, features and sections.</li><li>Emphasizes on structure of the application and integration with different modules</li></ol>",
  "Label.BrochureDesc": "eGramSwaraj facilitates decentralized planning, progress reporting, and accounting of activities. This brochure explains all the salient features of eGramSwaraj Application.",
  "Label.PaymentProtocolPolicyDesc": "PFMS is being mandated for utilization of CFC funds by Panchayats through integration of eGramSwaraj PFMS Interface(eGSPI). The document enlists the payment protocol to be followed by all the stakeholders viz. eGramSwaraj application, PFMS, empanelled banks and end users of the eGSPI",
  "Label.MajorSoPDesc": "The document is a collection of all the major SoPs that have been released by the Ministry in respect of different functionalities for the States to operate on eGramSwaraj PFMS Interface",
  "Label.InstructionOnBoardingDesc": "This document enlists the various instructions for onboarding of GPs on eGSPI.",
  "Label.RequirementFFCSchemeDesc": "This document enlists the various requirements of eGramSwaraj-PFMS Integration(eGSPI) for the Fifteen Finance Commission Scheme (FFC).",
  "Label.ProcessFlowFFCDesc": "This document provides the entire process flow of eGramSwaraj(accounting)-PFMS Process for FFC Scheme",
  "Label.MessageFFCSchemeDesc": "The document provides the description and details of various messages comes while using eGSPI",
  "Label.QueriesFFCSchemeDesc": "The document provides the list and details of various Frequently Asked Questions of eGSPI for FFC Scheme",
