  "Label.eGSAbout": "About eGramSwaraj",
  "Label.eGSAboutContent1": "To strengthen e-Governance in Panchayati Raj Institutions (PRIs) across the country, Ministry of Panchayati Raj (MoPR) has launched eGramSwaraj, a user-friendly web-based portal with the NIC as technical partner. eGramSwaraj aims to bring in better transparency in the decentralised planning, progress reporting and work-based accounting. It is a workflow enabled single “Government to Government” based platform for all planning & accounting needs of all tiers of panchayats.",
  "Label.ApplicationModules": "Application Modules",
  "Label.PanchayatProfiling": "Panchayat Profiling",
  "Label.PanchayatProfilingContent": "Basic details of PRIs along with elected representative’s particulars, to begin.",
  "Label.PlanningContent": "It captures the entire planning workflow starting from the identification of needs (wishes raised during various Gram Sabhas), to the last step of plan approval process as per the guidelines of various schemes.",
  "Label.ProgressPhysicalFinancial": "Progress (Physical & Financial)",
  "Label.ProgressPhysicalFinancialContent": "During plan execution, system records the activity wise physical progress along with PFMS based payments to respective vendors for financial achievements, along with app-based geotagging, for physical existence.",
  "Label.AssetDirectory": "Asset Directory",
  "Label.AssetDirectoryContent": "This module act as a repository of various asset created by PRIs, along with geotagging for physical existence and assign a code to each asset for its unique identification.",
  "Label.ReportingContent": "Different KPIs for dashboards, reports are designed for further decision making & monitoring. Various citizen centric reports are also provided.",
  "Label.AboutMoPR": "About Ministry of Panchayati Raj (MoPR)",
  "Label.AboutMoPRContent1": "The Ministry of Panchayati Raj is a branch of the Government of India looking after the ongoing process of decentralization and local governance in the States.",
